import React from "react";

function Signin() {
	return (
    <div>
      <form>
        {/*-- Email input-- */}
        <div class="mb-6">
          <input
            type="text"
            class="form-control block w-auto px-4 py-2 text-xl font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none"
            id="exampleFormControlInput2"
            placeholder="User Name"
          />
        </div>

        {/*-- Password input */}
        <div class="mb-6">
          <input
            type="password"
            class="form-control block w-auto px-4 py-2 text-xl font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none"
            id="exampleFormControlInput2"
            placeholder="Password"
          />
        </div>

        {/* 2 column grid layout for inline styling */}
        

        {/* Submit button */}
      </form>
    </div>
  );
}

export default Signin;
